      SELECT DISTINCT * FROM tab2 (FORMAT parquet) cor0 WHERE NOT 57 BETWEEN - 20 AND col1 * col0 * 74 + + col0 OR + ( 38 ) * + + col1 <= ( - col1 * - col1 );
  - name: tab2

outputs:
